window.bookSummaryJSON = "<p><b>The epic conclusion to the </b><b><i>War Core</i></b><b>&nbsp;series!</b></p> <p>Hugh Logan has won the battle for Los Angeles and secured his sector of the galaxy from the rampaging Ssath. What do you do when a former enemy offers peace and a chance to fight back against your true foe? Hugh Logan and his war core are called to battle, but this time, he finds himself in an uneasy alliance with the Ssath.</p> <p>With new allies fighting at his side and hardened veterans at his mechs' controls, Hugh must risk everything to remove the shackles of the GCA and free the universe from endless war.</p>"; 
